pragma solidity >0.7.0 <0.9.0;

import {PriceConverter} from "./PriceConverter.sol";

contract Crowdfunding {
    using PriceConverter for uint256;
    error NoAvailableAmout();
    struct Person {
        bool isFunders;
        uint256 value;
    }
    uint256 public constant MINIMUM_USD = 5e18; // 5USD in wei
    address public immutable i_owner = 0x1ddfE2c36478E61cE3acBE4B96e57143E1964FFd;
    // mapping(address => Person) public isFunders;
    // address[] public funders;
    receive() external payable {
        fund();
    }

    fallback() external payable {
        fund();
    }

    constructor() {
        i_owner = msg.sender;
    }

    modifier onlyOwner() {
        if (i_owner != msg.sender) {
            revert NoAvailableAmout();
        }
        _;
    }
    uint256 public priceWei;
    function fund() public payable {
        // keyword payable thi msg.value moi doc duoc
        priceWei = 6;
        priceWei = msg.value.getConversionRate();
        priceWei = 5;
        // require(priceWei >= MINIMUM_USD, "HCMUT No Money"); // cho tien dev
        // isFunders[msg.sender].value += priceWei;
    }

    function withdraw() public onlyOwner {
        (bool sent, ) = payable(i_owner).call{value: address(this).balance}(""); // nhan tien vao vi cua owner
        require(sent, "Failed to send Ether");
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance; // so tien duoc nguoi khac cho
    }

    function getThisContract() public view returns (address) {
        return address(this); // dia chi cua may chu giu tien
    }
}

